import React, { Component } from "react";
class Count extends Component {
  state = {
    count: 2,
    Tags: ["tag1", "tag2", "tag3", "tag4"],
  };

  renderDif() {
    let { Tags: csxz } = this.state;
    csxz.length === 0 ? (
      <h1>notinf to show</h1>
    ) : (
      csxz.map((tag) => <li key={tag}>{tag}</li>)
    );
  }
  renderTag() {
    if (this.state.Tags.length === 0) return <h1>notinf to show</h1>;
    return this.state.Tags.map((tag) => <li key={tag}>{tag}</li>);
  }

  render() {
    return (
      <React.Fragment>
        <ul>{this.renderTag()}</ul>
        {/* <button className="btn btn-warning">incriment</button> */}
      </React.Fragment>
    );
  }
}

export default Count;
